import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

class CharacterWindow extends React.Component() {
    constructor(){
        super();
    }
    render(){
        return (
            <View>
                <Text>
                    Hello World!
                </Text>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
      },
})

export default CharacterWindow;
